## Solution

To solve this problem, I will use React Context to create a global state for the Tooltip component. This will allow me to keep track of the currently open Tooltip and close it when a new one is opened.

First, let's create a new file called `TooltipContext.js`:

```jsx
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  const openTooltipHandler = (id) => {
    if (openTooltip === id) {
      closeTooltip();
    } else {
      setOpenTooltip(id);
      closeTooltip();
    }
  };

  return (
    <TooltipContext.Provider value={{ openTooltipHandler, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The provider component takes in children and sets up the state for the Tooltip component. We use `useState` to create a state variable called `openTooltip` and a function called `setOpenTooltip` to update it.

We also create two functions: `closeTooltip` and `openTooltipHandler`. The `closeTooltip` function sets the `openTooltip` state variable to `null`, which will close the currently open Tooltip. The `openTooltipHandler` function takes in an `id` parameter and updates the `openTooltip` state variable to that `id`. If the `openTooltip` state variable is already set to that `id`, it will call the `closeTooltip` function to close the Tooltip.

Now, let's create the Tooltip component itself. Create a new file called `Tooltip.js`:

```jsx
