## Answer (1)

You can use the `sort()` function in javascript to sort the data in the table. You can add an event listener to the headers to trigger the sorting.

Here is an example:

```
const table = document.querySelector('table');
const headers = table.querySelectorAll('th');

headers.forEach(header => {
  header.addEventListener('click', () => {
    const tbody = table.querySelector('tbody');
    const rows = Array.from(tbody.querySelectorAll('tr'));
    const data = Array.from(rows, row => {
      const cells = Array.from(row.querySelectorAll('td'));
      return {
        row,
        name: cells[0].textContent.trim(),
        age: parseInt(cells[1].textContent.trim()),
        address: cells[2].textContent.trim()
      };
    });

    const sortedData = data.sort((a, b) => {
      if (header.textContent.trim() === 'Name') {
        return a.name.localeCompare(b.name);
      } else if (header.textContent.trim() === 'Age') {
        return a.age - b.age;
      } else {
        return a.address.localeCompare(b.address);
      }
    });

    const sortedRows = sortedData.map(item => item.row);
    tbody.innerHTML = '';
    sortedRows.forEach(row => tbody.appendChild(row));
  });
});
