To create a custom WordPress block with a heading, paragraph, and image, you can use the Gutenberg Block API. Here's a step-by-step guide to creating a custom block:

1. Create a new directory in your WordPress theme or plugin for your custom block. For this example, we'll create a directory called `custom-block` inside the `blocks` directory of our theme.
2. Inside the `custom-block` directory, create a new file called `index.js`. This file will contain the JavaScript code for your custom block.
3. In `index.js`, start by importing the necessary dependencies:

```javascript
const { registerBlockType } = wp.blocks;
const { RichText, MediaUpload, BlockControls } = wp.editor;
const { Button } = wp.components;
```

4. Next, define your custom block by calling the `registerBlockType` function and passing in the necessary parameters:

```javascript
registerBlockType('my-plugin/custom-block', {
  title: 'Custom Block',
  icon: 'smiley',
  category: 'common',
  attributes: {
    title: {
      type: 'string',
      source: 'html',
      selector: 'h2',
    },
    body: {
      type: 'string',
      source: 'html',
      selector: 'p',
    },
    imageAlt: {
      attribute: 'alt',
      selector: '.my-image',
    },
    imageUrl: {
      attribute: 'src',
      selector: '.my-image',
    },
  },
  edit({ attributes, setAttributes }) {
    const getImageButton = (openEvent) => {
      if (attributes.imageUrl) {
        return (
          <img
            src={attributes.imageUrl}
            onClick={openEvent}
            className="image"
          />
        );
      } else {
        return (
          <div className="button-container">
            <Button onClick={openEvent} className="button button-large">
              Pick an image
            </Button>
          </div>
        );
      }
    };

    return (
      <div className="container">
        <MediaUpload
          onSelect={(media) => {
            setAttributes({
              imageAlt: media.alt,
              imageUrl: media.url,
            });
          }}
          type="image"
          value={attributes.imageID}
          render={({ open }) => getImageButton(open)}
        />
        <RichText
          key="editable"
          tagName="h2"
          placeholder="Your heading"
          value={attributes.title}
          onChange={(value) => setAttributes({ title: value })}
        />
        <RichText
          key="editable"
          tagName="p"
          placeholder="Your paragraph"
          value={attributes.body}
          onChange={(value) => setAttributes({ body: value })}
        />
      </div>
    );
  },
  save({ attributes }) {
    const { title, body, imageUrl, imageAlt } = attributes;

    return (
      <div className="container">
        <img src={imageUrl} alt={imageAlt} className="my-image" />
        <h2>{title}</h2>
        <p>{body}</p>
      </div>
    );
  },
});
```

